import Homepage from "../pages/Homepage/Homepage";
import OrderPage from "../pages/OderPage/OrderPage"
import Product from "../pages/ProductPage/Product"

const routes = [
   {
      path: "/",
      page: Homepage
   },
   {
      path: "/order",
      page: OrderPage
   },
   {
      path: "/product",
      page: Product
   },
]
export default routes
